pass: Pass
username: Sathish
spring:

  application:
    name: sathish-projects-git-config-server
  h2:
    console:
      enabled: true
  profiles:
    active: git
  security:
    user:
      name:
      password:
  cloud:
    config:
      server:
        git:
          uri: https://github.com/sathishjayapal/jubilant-memory
          default-label: main
          timeout: 5
          clone-on-start: true
          search-paths:
            - '{application}'
            - 'resumes*'
            - 'wi-traffic*'
            - 'running/*'
server:
  port: 8888
management:
  context-path: /sathishconfigserver
  endpoint:
    health:
      show-details: always
  endpoints:
    web:
      exposure:
        include: "*"
encrypt:
  key: 
